export const VehicleSearchBar = () => {
    return (
        <div>
            <Form>
      <Form.Group className="mb-3" controlId="formBasicEmail">
        <Form.Control type="Vehicle" placeholder="Recherchez un vehicule !" />
        </Form.Group>
        </Form>
        </div>
    )
}

export default VehicleSearchBar;
